 who threw the ball and the one who could not catch it - have to race to the center of the field. The one who reaches second loses.</p>\\n\\n<p>They were wondering if this is a fair game, they wanted to make sure if the players have the same distance to run.</p>\\n\\n<p>Can you help them out?</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b04bb618-5c97-459d-84da-3064558776ed\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"28b7de08-c712-4e1c-a1d5-fce5c56b15f8\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"299d7524-3823-4011-8f91-042ac90ba297\"},{\"params\":{\"elementList\":[{\"params\":{\"contentName\":\"Image\",\"alt\":\"field2\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA+gAAAEaCAIAAAANBOqIAAAAAXNSR0IArs4c6QAAAAlwSFlzAAAN/wAADf8B9IqyiQAAQABJREFUeAHs3Xmw7WtaF/Y1z/Pa05nuubcH+tLSQjcoU6MUVkjoAqViFRosNTjGxAGDMVbKqpCKQ8pyQAmUhgRDjFS0JCYQJBAERdS2bbqBpi/d3O47nHuGPa295nnK51kH/M8qy3uuxbV/69w+vc/ea72/933e97d/3+f7fJ/nSe/3+1TySiyQWCCxQGKBxAKJBRILJBZILJBY4Fe3BTK/uqeXzC6xQGKBxAKJBRILJBZILJBYILFAYoGwQALck3OQWCCxQGKBxAKJBRILJBZILJBY4G1ggQS4vw02KZliYoHEAokFEgskFkgskFggsUBigQS4J2cgsUBigcQCiQUSCyQWSCyQWCCxwNvAAglwfxtsUjLFxAKJBRILJBZILJBYILFAYoHEAglwT85AYoHEAokFEgskFkgskFggsUBigbeBBRLg/jbYpGSKiQUSCyQWSCyQWCCxQGKBxAKJBRLgnpyBxAKJBRILJBZILJBYILFAYoHEAm8DC+TeBnNMpphY4HPQAq+/nnr++c/BdSdLTiyQWODfTwu89lrq/v1/P5eWrCqxwL9DCySM+79DYyeXSiyQWCCxQGKBxAKJBRILJBZILPBva4EEuP/bWi75XGKBxAKJBRILJBZILPBvaIHp
